	add("bathsheba", "{\"term\":\"bathsheba\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Hebrew\"], \"text\":\"From Hebrew {{m|he|שֶׁבַע||daughter|tr\u003dbát}} + {{m|he|בַּת||seven|tr\u003dshéva}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"In the Old Testament, the wife of Uriah and later of David\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"3 And David sent and enquired after the woman. And one said, Is not this \u0027\u0027Bathsheba\u0027\u0027, the daughter of Eliam, the wife of Uriah the Hittite\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"of biblical origin\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1996\u0027\u0027, w:Martha Martha Grimes, \u0027Hotel Paradise\u0027, in \u0027Headline\u0027 (ISBN 0-7472-1538-3), page 172\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"I was kinda sweet on her my own self. Sheba Otis, her name was then.\u0027 I was surprised. \u0027She married a Queen? Which one?\u0027 \u0027Can\u0027t say.\u0027 He sighed. \u0027Her name\u0027s \u0027\u0027Bathsheba\u0027\u0027, but she never liked that much.\u0027 He turned to look at me. \u0027That\u0027s one of them Bible names\", \"priority\":5}]}, \"synonyms\":{}}");

