	add("bathyscaphe", "{\"term\":\"bathyscaphe\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"{{borrowing|fr|lang\u003den}}, from Ancient greek (to 1453) \u0027βαθύς\u0027 (lang\u003dgrc) + \u0027σκάφη\u0027 (little ship) Coined in 1940s by w:Auguste Piccard|Auguste Piccard, the inventor of the bathyscaphe.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A self-propelled deep-sea diving submersible for exploring the ocean depths, consisting of a crew cabin similar to a bathysphere suspended below a float filled with a buoyant liquid such as petrol\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1972\u0027\u0027, \u0027Oceanology\u0027, Volume 12, Issues 4-6, American Geophysical Union, [https://books.google.com.au/books?id\u003dBCNPAQAAIAAJ\u0026amp;q\u003d%22bathyscaphe%22%7C%22bathyscaphes%22\u0026amp;dq\u003d%22bathyscaphe%22%7C%22bathyscaphes%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;redir_esc\u003dy page 931\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The fact that the \u0027\u0027bathyscaphes\u0027\u0027 are self-propelled makes it possible to use them to study the ocean microstructure in the horizontal, although the experiment should include temporal changes, which can be achieved either by using associated buoy stations or using a second suspended \u0027\u0027bathyscaphe\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2001\u0027\u0027, Robert D. Ballard, Malcolm McConnell, \u0027Adventures in Ocean Exploration: From the Discovery of the Titanic to the Search for Noah\u0027s Flood\u0027, [https://books.google.com.au/books?id\u003dPKQPAQAAIAAJ\u0026amp;q\u003d%22bathyscaphe%22%7C%22bathyscaphes%22\u0026amp;dq\u003d%22bathyscaphe%22%7C%22bathyscaphes%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;redir_esc\u003dy page 216\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"It\u0027s ironic that when Piccard built his first \u0027\u0027bathyscaphe\u0027\u0027 in the 1940s people assumed the revolutionary design had evolved from his famous stratospheric balloon. In fact, the reverse was true\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"In fact, Piccard\u0027s prototype \u0027\u0027bathyscaphe\u0027\u0027 FNRS-2 (named for the Belgian national research foundation), which underwent sea trials in the Atlantic off Senegal in 1948, did possess all the attributes of a clumsy underwater balloon\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, Eric Gottfrid Swedin, \u0027Science in the Contemporary World: An Encyclopedia\u0027, [https://books.google.com.au/books?id\u003dLJQjKkphxjUC\u0026amp;pg\u003dPA297\u0026amp;dq\u003d%22bathyscaphe%22%7C%22bathyscaphes%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;redir_esc\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22bathyscaphe%22%7C%22bathyscaphes%22\u0026amp;f\u003dfalse page 297\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"After World War II, engineers built specialized submarines called \u0027\u0027bathyscaphes\u0027\u0027 to survive the intense pressures of the deep ocean. A pioneer in \u0027\u0027bathyscaphes\u0027\u0027 was the Swiss-born Belgian physicist Auguste Piccard (1884—1962), who had set the world altitude record in a balloon in 1932. Having turned his attention to the sea, Piccard and his son, Jacques Piccard (1922—), built a \u0027\u0027bathyscaphe\u0027\u0027 called the \u0027Trieste\u0027 after World War II\", \"priority\":9}]}, \"synonyms\":{}}");

	add("bathysiderodromophobia", "{\"term\":\"bathysiderodromophobia\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The irrational fear of subways and the underground in general\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Bradley\u0027s \u0027\u0027bathysiderodromophobia\u0027\u0027 prevents her from travelling easily\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1955\u0027\u0027, William Gaddis, \u0027The Recognitions: A novel\u0027, page 61\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Bathysiderodromophobia\u0027\u0027! What did I tell you! said an onlooker. Anselm looked up, his eyes narrowed. —And what\u0027s that in \u0027your\u0027 pocket\", \"priority\":4}]}, \"synonyms\":{}}");

	add("bathysphere", "{\"term\":\"bathysphere\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027βαθύς\u0027 (deep) + \u0027σφαῖρα\u0027 (sphere)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A spherical steel deep-diving chamber with perspex windows, in which persons are lowered to the depths by a cable to study the oceans and deep-sea life; the precursor to the bathyscaphe\", \"priority\":1}]}, \"synonyms\":{}}");

