	add("batiste", "{\"term\":\"batiste\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From French \u0027batiste\u0027 a form of \u0027\u0027 of disputed origin (“according to Littré and Scheler from the alleged original maker, Baptiste of Cambray; according to others, from its use in wiping the heads of children after baptism” – OED).\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A fine cloth made from cotton or linen; cambric\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1919,\u0027\u0027 , \u0027\u0027, Duckworth, hardback edition, page 10\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Clad in a Persian-Renaissance gown and a widow\u0027s tiara of white \u0027\u0027batiste\u0027\u0027, Mrs Thoroughfare, in all the ferment of a \u0027Marriage-Christening\u0027, left her chamber on vapoury autumn day and descending a few stairs, and climbing a few others, knocked a trifle brusquely at her son\u0027s wife\u0027s door\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1969\u0027\u0027, Vladimir Nabokov, \u0027Ada or Ardor\u0027, Penguin 2011, p. 88\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"He had started to stroke her, shivering, staring ahead, following with a blind man\u0027s hand the dip of her spine through the \u0027\u0027batiste\", \"priority\":5}]}, \"synonyms\":{}}");

	add("batlet", "{\"term\":\"batlet\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|bat|let|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A short bat for beating clothes when washing them\", \"priority\":1}]}, \"synonyms\":{}}");

	add("baton", "{\"term\":\"baton\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From French \u0027bâton\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A staff or truncheon, used for various purposes; as, the baton of a field marsha\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The stick of a conductor in musical performances\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An object transferred by runners in a relay race\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A short stout club used primarily by policemen; a truncheon\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"An abatement in coats of arms to denote illegitimacy. (Also spelled batune, baston\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A riband with the ends cut off, resembling a baton, as shown on a coat of arms\", \"priority\":6}]}, \"synonyms\":{}}");

	add("batology", "{\"term\":\"batology\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027βάτον\u0027 (lang\u003dgrc) {{suffix||ology|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The scientific study of plants in the genus \u0027Rubus\u0027, commonly known as brambles\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1905\u0027\u0027, (editor), \u0027Journal of Botany: British and Foreign\u0027, Volume 43, [http://books.google.com.au/books?id\u003d0dRCAAAAYAAJ\u0026amp;q\u003d%22batology%22\u0026amp;dq\u003d%22batology%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dAcr3UIeTNsG3kAXCiIGIAg\u0026amp;redir_esc\u003dy page 202\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"more than another that has always been clearly recognized by British botanists, it is \u0027R. leucostachys\u0027, in spite of the various forms, which, before they were detected as hybrids, were often a puzzle to our predecessors in British \u0027\u0027batology\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1999\u0027\u0027, \u0027The Naturalist\u0027, Volumes 124-127, [http://books.google.com.au/books?id\u003dRehJAAAAYAAJ\u0026amp;q\u003d%22batology%22\u0026amp;dq\u003d%22batology%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dAcr3UIeTNsG3kAXCiIGIAg\u0026amp;redir_esc\u003dy page 112\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Further knowledge of \u0027Rubus\u0027 plant geography is steadily emerging, particular[ly] as co-workers such as D. Grant and T. Schofield are also contributing substantially to Yorkshire \u0027\u0027batology\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, \u0027Rubus Armeniacus: A Common Architectural Decorative Motif in the Temperate Mesophytic Region\u0027, in \u0027Occasional Work and Seven Walks from the Office for Soft Architecture\u0027, [http://books.google.com.au/books?id\u003dZ1gYX1CnkQgC\u0026amp;pg\u003dPA125\u0026amp;dq\u003d%22batology%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dAcr3UIeTNsG3kAXCiIGIAg\u0026amp;redir_esc\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22batology%22\u0026amp;f\u003dfalse page 125\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"In \u0027Species Plantarum\u0027, in 1753, Linnaeus identified two European species of \u0027Rubus\u0027 within the large five-petaled family \u0027Rosa\u0027, thus beginning one of taxonomy′s largest studies — \u0027\u0027batology\", \"priority\":8}]}, \"synonyms\":{}}");

	add("batoon", "{\"term\":\"batoon\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"Latin\"], \"text\":\"From French {{m|fr|bâton}}, from Latin {{m|la|bastum||stick}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A baton\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1819\u0027\u0027, Walter Scott, \u0027Ivanhoe\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Of this mighty Order I am no mean member, but already one of the Chief Commanders, and may well aspire one day to hold the \u0027\u0027batoon\u0027\u0027 of Grand Master\", \"priority\":3}]}, \"synonyms\":{}}");

	add("batophobia", "{\"term\":\"batophobia\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The fear of high objects or of high objects falling down\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1912\u0027\u0027, Edwin Ash, \u0027Nerves and the Nervous\u0027, Brentano\u0027s (1912), [http://books.google.ca/books?id\u003daJk0AQAAMAAJ\u0026amp;q\u003dbatophobia\u0026amp;dq\u003dbatophobia page 23\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Batophobia\u0027\u0027, or fear that high things will fall, is not uncommon, and is matched by the perhaps still more common fear that one may fall off high places should one be perched on an altitude, or on the top of a bridge, or walking along cliffs\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1995\u0027\u0027, Mir M. Ali \u0026amp; Paul J. Armstrong, \u0027Architecture of Tall Buildings\u0027, McGraw-Hill (1995), ISBN 9780070125407, [http://books.google.com/books?id\u003dnCcrPjOYciUC\u0026amp;q\u003dbatophobia\u0026amp;dq\u003dbatophobia page 303\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Batophobia\u0027\u0027 is the specific fear of high objects, such as tall buildings. \u0027\u0027Batophobia\u0027\u0027 may be related to acrophobia — the fear of high places, or to \u0027anablepophobia\u0027 — the fear of looking up at high places\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027, Alexei Barrionuevo, \u0026quot;[http://cityroom.blogs.nytimes.com/2012/02/03/big-deal-the-world-at-its-feet/?_r\u003d0 The World at Its Feet]\u0026quot;, \u0027The New York Times\u0027, 3 February 2012\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"That doesn’t seem to be a problem for the wealthy investors who are wiring millions of dollars to New York to snatch up a piece of 157 West 57th Street — what will be New York City’s tallest residential building, with 90 floors overlooking Central Park\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A bigger worry for these buyers may be acrophobia (fear of heights) or \u0027\u0027batophobia\u0027\u0027 (fear of being near an object of great height, like a skyscraper\", \"priority\":8}]}, \"synonyms\":{}}");

