	add("batshit", "{\"term\":\"batshit\", \"etymology\":{\"influencers\":[{}], \"languages\":[], \"text\":\"Presumably from \u0027batty\u0027 (crazy) itself from earlier \u0027have bats in one\u0027s belfry\u0027 from tendency of bats to fly around erratically. Possibly influenced by or derived from \u0027apeshit\u0027 particularly in phrase \u0027go apeshit\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"fecal matter produced by bats\", \"priority\":1}]}, \"synonyms\":{}}");

