	add("battalion", "{\"term\":\"battalion\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From French \u0027bataillon\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An army unit having two or more companies, etc. and a headquarters. Traditionally forming part of a regiment\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"an army unit having two or more companies, etc. and a headquarters; forming part of a brigade\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Any large body of troops\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A great number of things\", \"priority\":4}]}, \"synonyms\":{}}");

