	add("batterie", "{\"term\":\"batterie\", \"etymology\":{\"influencers\":[{}], \"languages\":[], \"text\":\"{{borrowing|fr|batterie|lang\u003den}}, from \u0027battre\u0027 (to hit)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A brilliant display of virtuosity in which the dancer\u0027s legs open and close rapidly while in the air, with the illusion of striking together and rebounding\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The percussion section of an orchestra or band, the battery; marching instruments in a drumline, as opposed to the pit\", \"priority\":2}]}, \"synonyms\":{}}");

	add("battery", "{\"term\":\"battery\", \"etymology\":{\"influencers\":[{},{}], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027batterie\u0027 from Old french (842-ca. 1400) \u0027baterie\u0027 (action of beating) from \u0027batre\u0027 (battre) from Latin {{m|la|battuō||beat}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"thumb|right|Electrical batteriesImage:Youghal thumb|right|A cannon batter\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A set of electrically connected electrochemical or electrostatic cells (w:Battery Wikipedia\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Act of inflicting unlawful physical violence to a person, legally distinguished from assault which includes the threat of impending violence\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, Mike Molan, \u0027Modern Criminal Law\u0027, section 7.2.2-3:\u0026lt;!-- 5th ed. p. 221-222 --\u0026gt\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"lt;!--The \u0027mens rea\u0027 for assault requires proof that [the defendant] intended to cause P to apprehend immediate physical violence. [...]--\u0026gt; A \u0027\u0027battery\u0027\u0027 is the actual infliction of unlawful personal violence. [...] [The defendant] fell to the ground and lashed out with his feet and in doing so kicked the hand of one of the police officers, fracturing a bone. He was charged with assault [...] although this was a \u0027\u0027battery\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A coordinated group of artillery weapons\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"An elevated platform on which cannon could be placed\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"An array of similar things\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Schoolchildren take a \u0027\u0027battery\u0027\u0027 of standard tests to measure their progress\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A set of small cages where hens are kept for the purpose of farming their eggs\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"The catcher and the pitcher togethe\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"Two or more major pieces on the same rank, file, or diagona\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"The state of a firearm when it is possible to be fired\", \"priority\":13}]}, \"synonyms\":{}}");

	add("battle", "{\"term\":\"battle\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"from places in England that have been sites of a battle\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"a town in East Sussex, supposed site of the Battle of Hastings\", \"priority\":2}]}, \"synonyms\":{}}");

	add("battlefield", "{\"term\":\"battlefield\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|battle|field|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The area where a land battle is or was fought, which is not necessarily a field\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1886\u0027\u0027 \u0027The night of the 16th of May found McPherson\u0027s command bivouacked from two to six miles west of the \u0027\u0027battlefield\u0027\u0027, along the line of the road to Vicksburg\u0027 — Ulysses S. Grant, \u0027Personal memoirs of U.S. Grant\u0027, [http://etext.virginia.edu/etcbin/ot2www-pubeng?specfile\u003d/texts/english/modeng/publicsearch/modengpub.o2w\u0026amp;act\u003dsurround\u0026amp;offset\u003d327246025\u0026amp;tag\u003dGrant,+Ulysses+S.+(Ulysses+Simpson),+1822-1885.:+Personal+memoirs+of+U.S.+Grant,+Volume+I,+1885\u0026amp;query\u003dbattlefield\u0026amp;id\u003dGraPers Chapter 35\", \"priority\":2}]}, \"synonyms\":{}}");

	add("battlement", "{\"term\":\"battlement\", \"etymology\":{\"influencers\":[{},{}], \"languages\":[\"English\", \"old french (842-ca. 1400)\"], \"text\":\"From Old french (842-ca. 1400) \u0027bataillement\u0027 earlier \u0027bastillement\u0027 (fortification) from \u0027bastillier\u0027 (to fortify, to equip with battlements) from \u0027bastille\u0027 (fortress) (see \u0027bastion\u0027 .\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"In fortification: an indented parapet, formed by a series of rising members called cops or merlons, separated by openings called crenelles or embrasures, the soldier sheltering himself behind the merlon while he fires through the embrasure or through a loophole in the battlement\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Any high wall for defense\", \"priority\":2}]}, \"synonyms\":{}}");

	add("battue", "{\"term\":\"battue\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From Portuguese \u0027batuda\u0027 or Italian \u0027battuta\u0027 (a beating); See Latin \u0027battuo\u0027, (\u0027to beat.\u0027)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A form of hunting in which game is forced into the open by the beating of sticks on bushes etc\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The game thus forced into the open\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A hunt performed in this manner\", \"priority\":3}]}, \"synonyms\":{}}");

